The HTTP cache library provides comprehensive per-request customization capabilities for cache keys, cache options, and cache modes. Here's a complete example showing all features: use http_cache::{HttpCacheOptions, CACacheManager, HttpCache, CacheMode};
use std::sync::Arc;
use std::time::Duration; let manager = CACacheManager::new("./cache".into(), true); let options = HttpCacheOptions { // 1. Configure cache keys when initializing (per-request cache key override) cache_key: Some(Arc::new(|req: &http::request::Parts| { // Generate different cache keys based on request properties let path = req.uri.path(); let query = req.uri.query().unwrap_or(""); match path { // API endpoints: include user context in cache key p if p.starts_with("/api/") => { if let Some(auth) = req.headers.get("authorization") { format!("api:{}:{}:{}:authenticated", req.method, path, query) } else { format!("api:{}:{}:{}:anonymous", req.method, path, query) } }, // Static assets: simple cache key p if p.starts_with("/static/") => { format!("static:{}:{}", req.method, req.uri) }, // Dynamic pages: include important headers _ => { let accept_lang = req.headers.get("accept-language") .and_then(|h| h.to_str().ok()) .unwrap_or("en"); format!("page:{}:{}:{}:{}", req.method, path, query, accept_lang) } } })), // 2. Override cache options on a per-request basis (request-based cache mode) cache_mode_fn: Some(Arc::new(|req: &http::request::Parts| { let path = req.uri.path(); // Admin endpoints: never cache if path.starts_with("/admin/") { return CacheMode::NoStore; } // Check for cache control headers from client if req.headers.contains_key("x-no-cache") { return CacheMode::NoStore; } // Development mode: bypass cache if req.headers.get("x-env").and_then(|h| h.to_str().ok()) == Some("development") { return CacheMode::Reload; } // Static assets: force cache if path.starts_with("/static/") || path.ends_with(".css") || path.ends_with(".js") { return CacheMode::ForceCache; } // Default behavior for everything else CacheMode::Default })), // 3. Additional per-response cache override (response-based cache mode) response_cache_mode_fn: Some(Arc::new(|req: &http::request::Parts, response| { // Override cache behavior based on response content and status // Never cache error responses if response.status >= 400 { return Some(CacheMode::NoStore); } // Content-type based caching if let Some(content_type) = response.headers.get("content-type") { match content_type.to_str().unwrap_or("") { // Force cache JSON APIs even with no-cache headers ct if ct.starts_with("application/json") => Some(CacheMode::ForceCache), // Don't cache HTML in development ct if ct.starts_with("text/html") => { if req.headers.get("x-env").and_then(|h| h.to_str().ok()) == Some("development") { Some(CacheMode::NoStore) } else { None // Use default behavior } }, _ => None, } } else { None } })), // Cache busting for related resources cache_bust: Some(Arc::new(|req: &http::request::Parts, _cache_key_fn, current_key| { let path = req.uri.path(); // When updating user data, bust user-specific caches if req.method == "POST" && path.starts_with("/api/users/") { if let Some(user_id) = path.strip_prefix("/api/users/").and_then(|s| s.split('/').next()) { return vec![ format!("api:GET:/api/users/{}:authenticated", user_id), format!("api:GET:/api/users/{}:anonymous", user_id), format!("api:GET:/api/users:authenticated"), ]; } } vec![] // No cache busting by default })), // Global cache duration limit max_ttl: Some(Duration::from_secs(86400)), // Enable cache status headers for debugging cache_status_headers: true, ..Default::default()
}; let cache = HttpCache { mode: CacheMode::Default, // Can be overridden by cache_mode_fn and response_cache_mode_fn manager, options,
};

