We'll show the base structs for both traditional and streaming cache managers. For traditional caching, we'll use a simple struct that stores the cache directory path: /// Traditional cache manager using cacache for disk-based storage
#[derive(Debug, Clone)]
pub struct CACacheManager { /// Directory where the cache will be stored. pub path: PathBuf, /// Options for removing cache entries. pub remove_opts: cacache::RemoveOpts,
} For streaming caching, we'll use a struct that stores the root path for the cache directory and organizes content separately: /// File-based streaming cache manager
#[derive(Debug, Clone)]
pub struct StreamingManager { root_path: PathBuf, ref_counter: ContentRefCounter, config: StreamingCacheConfig,
} The StreamingManager follows a "simple and reliable" design philosophy: Focused functionality : Core streaming operations without unnecessary complexity Simple configuration : Minimal options with sensible defaults Predictable behavior : Straightforward LRU eviction and error handling Easy maintenance : Clean code paths for debugging and troubleshooting This approach prioritizes maintainability and reliability over feature completeness, making it easier to understand, debug, and extend. For traditional caching, we use a simple Store struct that contains both the response and policy together: /// Store struct for traditional caching
#[derive(Debug, Deserialize, Serialize)]
struct Store { response: HttpResponse, policy: CachePolicy,
} For streaming caching, we create a metadata struct that stores response information separately from the content: /// Metadata stored for each cached response
#[derive(Debug, Clone, Serialize, Deserialize)]
pub struct CacheMetadata { pub status: u16, pub version: u8, pub headers: HashMap<String, String>, pub content_digest: String, pub policy: CachePolicy, pub created_at: u64,
} This struct derives serde Deserialize and Serialize to ease the serialization and deserialization with JSON for the streaming metadata, and postcard for the traditional Store struct. Important: The bincode serialization format has been deprecated due to RUSTSEC-2025-0141 (bincode is unmaintained). New implementations should use postcard instead. The library still supports bincode through legacy feature flags (manager-cacache-bincode, manager-moka-bincode) for backward compatibility, but these will be removed in the next major version.

